import numpy as np

v_0 = 200 #m/s
a = -9.81 #m/s^2
castle_distance = 2000 # m

for theta in range(90,45,-1):
    theta_radians = theta*np.pi/180 #using the numpy package to get the value of pi
    v_0_vertical = np.sin(theta_radians)*v_0 #using the numpy package for the sin() function
    v_0_horizontal = np.cos(theta_radians)*v_0 #using the numpy package for the cos() function

    t = -v_0_vertical*2/a

    distance = v_0_horizontal * t

    if(distance>=castle_distance):
        print(f"The angle which will make the ball reach the castle = {round(theta)} degrees")
        break

if distance<castle_distance:
    print("The cannon ball is too slow, none of the angles will allow it to reach the castle")

