# Exercise 3 parts a), b) and c)

# 'fibonacci' list is created with initial items [1,1].
fibonacci = [1,1]

# 'n' is set to the user's input.
n = int(input("n = "))

# A for loop is iterated 'n-2' iterations and appends the sum of the last two items.
for i in range(n-2):
    fibonacci.append(fibonacci[-1] + fibonacci[-2])

# Fibonacci's sequence with 'n' amount of values is printed.
print(f"{fibonacci} # fibonacci")

# The length of the list is printed using the len() function.
print(f"Length of the list: {len(fibonacci)}")

# The middle term is printed using floor division operator on the length of the list as an index.
print(f"Middle term: {fibonacci[len(fibonacci)//2]}")

# The last term is printed using index -1.
print(f"Last term: {fibonacci[-1]}")

# The list is printed backwards using the slicing function with step value -1.
print(f"List printed backwards: {fibonacci[::-1]}")

# 'primonacci' is initially set to an empty list.
primonacci = []

# A for loop is iterated over the range 2 to the length of the 'fibonacci' list.
for i in range(2,len(fibonacci)):
    # the variable 'prime' is initially set to True.
    prime = True
    # A nested for loop is iterated from 2 to square root of the number being checked.
    for k in range(2,round(fibonacci[i]**(1/2))+1):
        # If the number is divisible by any number in the range, 'prime' is set to False and the loop is broken out of.
        if fibonacci[i] % k == 0:
            prime = False
            break
    # If no divisible number was detected, 'prime' remains True and the number is appended to 'primonacci'.
    if prime:
        primonacci.append(fibonacci[i])

# The primonacci list is printed.
print(f"{primonacci} # primonacci")

"""To print the list backwards, the list slicing function was used with a step value of -1, such that the list would be printed backwards from the last element to the first element in steps of 1. Note that the start and stop indexes were left as blank and seperated by a colon so that their default value is taken (initial element index and final element index), making the list slicing function span all the elements.

For the loop checking if a number is prime, the square root of said number was chosen as the upper bound to reduce iterations. This is because for any integer n to be divisible by another integer (other than itself and 1), there must be two other integers that are both equal to the square root of n, or one integer is smaller and one integer is larger than the square root of n, such that, when multiplied, yield the number n. In other words, for n = a * b, where n, a, b  Z, we can state that a <= n**(1/2) <= b < n. By checking for any divisors up to the square root of n, we are essentially checking if some integer 'a' exists, which would imply that 'b' also exists and thus the number n would not be prime. This reduces the number of iterations dramatically for large numbers.
"""

# Exercise 3 part d)

# 'fibonacci' list is created with initial items [1,1].
fibonacci = [1,1]

# 'n' is set to the user's input.
n = int(input("n = "))

# 'i' is set to 0 outside the while loop.
i = 0

# A while loop is created to append the sum of the last two items in the list 'n-2' number of times.
while i < n-2:
    fibonacci.append(fibonacci[-1] + fibonacci[-2])
    i += 1

# The created fibonacci sequence with 'n' amount of values is printed.
print(f"{fibonacci} # fibonacci")

# The length of the list is printed using the len() function.
print(f"Length of the list: {len(fibonacci)}")

# The middle term is printed using floor division operator on the length of the list as an index.
print(f"Middle term: {fibonacci[len(fibonacci)//2]}")

# The last term is printed using index -1.
print(f"Last term: {fibonacci[-1]}")

# The list is printed backwards using the slicing function with step value -1.
print(f"List printed backwards: {fibonacci[::-1]}")

# 'primonacci' is initially set to an empty list.
primonacci = []

# 'j' is initially set to 2 outside the loop since the first two items (index 0 and 1) are 1 which is not prime.
j = 2

# A while loop is created with condition 'j' is less than the length of the fibonacci list.
while j < len(fibonacci):
    # 'g' is reset to 2 every iteration.
    g = 2
    # A nested while loop is created to detect prime numbers.
    while g < round(fibonacci[j]**(1/2)):
        # If the number is divisible by 'g', break out of the loop.
        if fibonacci[j] % g == 0:
            break
        # Otherwise, 1 is added to 'g'.
        g += 1
    # If the last item checked was divisible by 'g', 1 is added to 'j' and the outside while loop is iterated again.
    if fibonacci[j] % g == 0 and fibonacci[j] != 2:
        j += 1
        continue
    # Otherwise, the item is prime and is appended to 'primonacci' and 1 is added to 'j'.
    primonacci.append(fibonacci[j])
    j += 1

# The primonacci list is printed.
print(f"{primonacci} # primonacci")